__NUXT_JSONP__("/drugs/Pomegranate_Liquid_Extract", (function(a,b,c,d){return {data:[{drug:{slug:b,emaEpar:[],fdaDrugLabel:[],id:b,nciThesaurus:{casRegistry:a,chebiId:a,chemicalFormula:a,definition:"A liquid extract preparation derived from pomegranate (Punica granatum) seeds with antioxidant, and potential antineoplastic and chemopreventive activities. Pomegranate liquid extract contains flavonoids which may promote differentiation and apoptosis in tumor cells by down-regulating vascular endothelial growth factor (VEGF) and stimulating migration inhibitory factor (MIF), thus inhibiting angiogenesis. Pomegranate liquid extract flavanoids also scavenge reactive oxygen species (ROS) and, in some cell types, may prevent ROS-mediated cell injury and death.",fdaUniiCode:"P52EO36K90",identifier:"C78866",preferredName:c,semanticType:"Pharmacologic Substance",subclassOf:["C106105"],synonyms:["Dadima Fruit Water","POMEGRANATE FRUIT VOLATILE OIL",c,"Punica granatum Fruit Volatile Oil"]},dir:"\u002Fdrugs",path:"\u002Fdrugs\u002FPomegranate_Liquid_Extract",extension:".json",createdAt:d,updatedAt:d}}],fetch:{},mutations:void 0}}("","Pomegranate_Liquid_Extract","Pomegranate Liquid Extract","2021-10-30T13:45:22.703Z")));